import React, { useEffect, useState } from "react";
import { Form } from "react-bootstrap";

function Projects() {
  const [data, setData] = useState({ Project : ["gfd","hg"]});

  const link = "http://localhost:8081/getData/naveen@gmail.com";

  const fetchProject = async () => {
    try {
      const res = await fetch(link);
      const d = await res.json();
      console.log(d);
      setData({
        ...data,
        projects:d
      });
      console.log(data)
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    fetchProject();
  }, []);

  const projects = [];

  return (
    <div>
      <Form>
        {data.Project && data?.Project.map((project, index) => (
          <div key={index}>
            <div>
              <label htmlFor={`projectname_${index}`}>Project Name</label>
              <input
                id={`projectname_${index}`}
                type="text"
                value={project.projectName}
                readOnly
              />
            </div>
            <div>
              <label htmlFor={`projectdescription_${index}`}>
                Project Description
              </label>
              <input
                id={`projectdescription_${index}`}
                type="text"
                value={project.projectDescription} // Replace with the actual property name
                readOnly
              />
            </div>
          </div>
        ))}
      </Form>
    </div>
  );
}

